/// Represents a constraint system which can have new variables
/// allocated and constrains between them formed.
pub trait ConstraintSystem<F: Field>: Sized { /// Represents the type of the "root" of this constraint system /// so that nested namespaces can minimize indirection. type Root: ConstraintSystem<F>; /// Return the "one" input variable fn one() -> Variable { Variable::new_unchecked(Index::Public(0)) } /// Allocate a private variable in the constraint system. The provided /// function is used to determine the assignment of the variable. The /// given `annotation` function is invoked in testing contexts in order /// to derive a unique name for this variable in the current namespace. fn alloc<FN, A, AR>(&mut self, annotation: A, f: FN) -> Result<Variable, SynthesisError> where FN: FnOnce() -> Result<F, SynthesisError>, A: FnOnce() -> AR, AR: AsRef<str>; /// Allocate a public variable in the constraint system. The provided /// function is used to determine the assignment of the variable. fn alloc_input<FN, A, AR>(&mut self, annotation: A, f: FN) -> Result<Variable, SynthesisError> where FN: FnOnce() -> Result<F, SynthesisError>, A: FnOnce() -> AR, AR: AsRef<str>; /// Enforce that `A` * `B` = `C`. The `annotation` function is invoked in /// testing contexts in order to derive a unique name for the constraint /// in the current namespace. fn enforce<A, AR, LA, LB, LC>(&mut self, annotation: A, a: LA, b: LB, c: LC) where A: FnOnce() -> AR, AR: AsRef<str>, LA: FnOnce(LinearCombination<F>) -> LinearCombination<F>, LB: FnOnce(LinearCombination<F>) -> LinearCombination<F>, LC: FnOnce(LinearCombination<F>) -> LinearCombination<F>; /// Create a new (sub)namespace and enter into it. Not intended /// for downstream use; use `namespace` instead. fn push_namespace<NR, N>(&mut self, name_fn: N) where NR: AsRef<str>, N: FnOnce() -> NR; /// Exit out of the existing namespace. Not intended for /// downstream use; use `namespace` instead. fn pop_namespace(&mut self); /// Gets the "root" constraint system, bypassing the namespacing. /// Not intended for downstream use; use `namespace` instead. fn get_root(&mut self) -> &mut Self::Root; /// Begin a namespace for this constraint system. fn ns<NR, N>(&mut self, name_fn: N) -> Namespace<'_, F, Self::Root> where NR: AsRef<str>, N: FnOnce() -> NR, { self.get_root().push_namespace(name_fn); Namespace(self.get_root(), PhantomData) } /// Output the number of constraints in the system. fn num_constraints(&self) -> usize; /// Output the number of public input variables to the system. fn num_public_variables(&self) -> usize; /// Output the number of private input variables to the system. fn num_private_variables(&self) -> usize; /// Output whether the constraint system is in the setup mode. fn is_in_setup_mode(&self) -> bool;
} A constraint system can have new variables (signals) allocated and constrains that are formed between them. Structs that implement the ConstraintSystem trait can: Allocate private and public variables. Enforce that A * B = C, being A, B and C linear combinations with coefficients in a given field. Enter into new (sub)namespaces and exit from them. Begin a namespace for its system.

