pub struct Ledger<N: Network> { /// The canonical chain of blocks. canon_blocks: Blocks<N>, /// The set of unknown orphan blocks. orphan_blocks: HashMap<u32, Block<N>>, /// The pool of unconfirmed transactions. memory_pool: MemoryPool<N>,
} The Ledger keeps track of the canonical chain (current chain), the orphan blocks (yet to be confirmed) and the unconfirmed transactions. After a few getters we then get to the interesting stuff, which is actually altering state. add_next_block, to_ledger_proof and to_ledger_tree immediately call the respective method of canon_blocks, so we'll handle that later when we talk about Blocks. add_orphan_block is pretty straightforward, it suffices to know that it checks that the block is in fact orphan (not present in the canonical chain). question : documentation says /// Adds the given orphan block, if it is well-formed and does not already exist. but it never validates the well-formedness of the block, is that missing or are Block<N> validated before constructing? /// Adds the given unconfirmed transaction to the memory pool.
pub fn add_unconfirmed_transaction(&mut self, transaction: &Transaction<N>) -> Result<()> { ensure!( self.canon_blocks.contains_ledger_root(&transaction.ledger_root()), "Transaction references a non-existent ledger root" ); // Ensure the transaction does not contain serial numbers already in the canon chain. for serial_number in transaction.serial_numbers() { ensure!( !self.canon_blocks.contains_serial_number(serial_number), "Transaction contains a serial number already in existence" ); } // Ensure the transaction does not contain commitments already in the canon chain. for commitment in transaction.commitments() { ensure!( !self.canon_blocks.contains_commitment(commitment), "Transaction contains a commitment already in existence" ); } // Attempt to add the transaction into the memory pool. self.memory_pool.add_transaction(transaction)?; Ok(())
} A transaction needs to reference the canonical chain's root, and all of its serial numbers and it's commitment need to be unused in the canonical chain to be included in the transaction memory pool. The juciest function is mine_next_block which performs the following steps: Ensure that the new timestamp is ahead of the previous timestamp (it's more of a fix it if it is not ahead, it won't throw an error if it is behind). Compute the block difficulty (currently uses the height as well as some of the genesis_block parameters) Compute the cumulative weight $\sum_{b \in \text{canonical_chain}} u64_{\text{max}} / \text{difficulty}_b$ including the candidate block. Construct the new block transactions. Build coinbase and block transactions containing the coinbase and the mempool transactions (there's a VirtualMaching::execute call behind the scenes) Construct the block template. Mine the next block. Attempt to add the block to the canon chain. On success , clear the memory pool of its transactions.

