} Most functions in blocks.rs are getters/setters that delegate the responsibility to either the ledger_tree, previous_hashes, headers, or transactions. One of the 'heavy' functions is add_next, which adds a block as the latest in the canonical chain and is used by the Ledger. It runs some verifications by ensuring: The given block is valid The given block has the correct block height The given block height does not already exist in the ledger The given block has the appropiate previous block hash The given block hash does not already exist in the ledger The next block timestamp is within the declared time limit The given block timestamp is after the current timestamp The given block difficulty target is correct The expected cumulative weight is computed correctly The given cumulative weight is correct. Each transaction in the block does not already exist in the ledger Each transaction's ledger root is the same as the ledger's Each serial number does not exist in the ledger Each commitment does not exist in the ledger And after that it attempts to add the block in each structure. // Add the block to the ledger. This code section executes atomically.
