a[LedgerProof] --> c[RecordProof] c[RecordProof] --> d[BlockHeaderInclusionProof]
c[RecordProof] --> e[TransactionsInclusionProof]
c[RecordProof] --> f[LocalInclusionProof] d[BlockHeaderInclusionProof] --> g[BlockHeader::to_header_inclusion_proof]
e[TransactionsInclusionProof] --> h[Transactions::to_transactions_inclusion_proof]
