i[Transitions::to_local_proof] --> l[Transitions::to_transition_inclusion_proof] The last function is assert_retarget, which is used to compute the difficulty of the next block to be mined, and is based on the difficulty retarget algorithm from the zcash protocol . /// T_{i+1} = T_anchor * 2^((S - B * N) / tau).
