The ledger tree is a merkle tree pub struct LedgerTree<N: Network> { #[derivative(Debug = "ignore")] tree: Arc<MerkleTree<N::LedgerRootParameters>>, block_hashes: HashMap<N::BlockHash, u32>, current_index: u32,
} The tree is the actual Merkle Tree, but the block_hashes are used to keep track of the blocks in the tree (lookup is faster) and to map the block hash to its respective height in the tree. The current index keeps track of the index of the last added block in the tree There are two methods for adding blocks, add and add_all. Those are pretty much well documented. One thing i noticed is this piece: self.tree = match self.current_index { 0 => Arc::new(MerkleTree::<N::LedgerRootParameters>::new::<N::BlockHash>( Arc::new(N::ledger_root_parameters().clone()), block_hashes, )?), _ => Arc::new(self.tree.rebuild(self.current_index as usize, block_hashes)?),
}; question : why would you handle things differently? question2 : why do we do this twice? ensure!( (self.current_index as usize).saturating_add(num_block_hashes) <= u32::MAX as usize, "The ledger tree will reach its maximum size." ); self.current_index = self .current_index .checked_add(num_block_hashes as u32) .ok_or_else(|| anyhow!("The index exceeds the maximum number of allowed block hashes."))?; let end_index = self.current_index.checked_sub(1).ok_or_else(|| anyhow!("Integer underflow."))?; The rest of the methods are getters and setters, the MerkleTree takes care of the inclusion proof: /// Returns the Merkle path for a given block hash.
fn to_ledger_inclusion_proof(&self, block_hash: &N::BlockHash) -> Result<MerklePath<N::LedgerRootParameters>> { match self.get_block_hash_index(block_hash) { Some(index) => Ok(self.tree.generate_proof(*index as usize, block_hash)?), _ => Err(MerkleError::MissingLeaf(format!("{}", block_hash)).into()), }
}
